import React, { Component } from 'react'

export class Ulternative_If_Else extends Component {

    constructor(){
        super()
        this.state = {
            login : true
        }
    }
    render() {
        return (
            this.state.login ? (
                <button type="button" class="btn btn-warning">Logout?....(Ulternative_If_Else)</button>
            ) :
            (
                <button type="button" class="btn btn-primary">Login Now ....(Ulternative_If_Else)</button>
            )
        )
    }
}

export default Ulternative_If_Else
